export const ModularCardProduct = (
  grid: CardProductGrids,
  groupHasBadge: boolean,
  title?: string,
  states?: CardProductStateProps,
  showBasket?: boolean,
  showBadges?: boolean,
  showDelivery?: boolean,
  showEnergyEfficiency?: boolean,
  showServiceWarranty?: boolean,
  showShippingInfo?: boolean,
  showBasePrice?: boolean,
  showPickup?: boolean,
  showWishlist?: boolean,
  showQuantity?: boolean
) => (
  <CardProduct grid={grid} groupHasBadge={groupHasBadge} states={states}>
    {showBadges ? (
      <CardProduct.Wrapper area={Areas.BADGES}>
        <CardProduct.Badges badges={Badges.badges} />
      </CardProduct.Wrapper>
    ) : null}

    <CardProduct.Wrapper area={Areas.TITLE}>
      <CardProduct.Title title={title} />
      <CardProduct.Manufacturer text={Manufacturer.text} />
    </CardProduct.Wrapper>

    {showEnergyEfficiency ? (
      <CardProduct.EnergyEfficiency
        energyEfficiency={EnergyEfficiency.energyEfficiency}
        datasheet={EnergyEfficiency.datasheet}
      />
    ) : null}

    {showServiceWarranty ? (
      <CardProduct.ServiceWarranty
        label={ServiceWarranty.label}
        onClick={ServiceWarranty.onClick}
      />
    ) : null}

    {grid === CardProductGrids.BUNDLE ? (
      <CardProduct.ProductImage
        src={ProductImage.src}
        featureLogoSrc={ProductImage.featureLogoSrc}
      />
    ) : (
      <CardProduct.Wrapper area={Areas.PRODUCTIMAGEANDRATING}>
        <CardProduct.ProductImage
          src={ProductImage.src}
          featureLogoSrc={ProductImage.featureLogoSrc}
        />
        <CardProduct.Rating
          ariaLabel={Rating.ariaLabel}
          value={Rating.value}
          description={Rating.description}
        />
      </CardProduct.Wrapper>
    )}
    {grid === CardProductGrids.ROW ? (
      <CardProduct.Wrapper area={Areas.FEATURELIST}>
        <CardProduct.FeatureList items={FeatureList.items} />
      </CardProduct.Wrapper>
    ) : null}

    <CardProduct.Wrapper area={Areas.PRICE}>
      <CardProduct.Price
        prefix={Price.prefix}
        amount={Price.amount}
        currency={Price.currency}
        basePrice={showBasePrice ? Price.basePrice : undefined}
        shippingInfo={showShippingInfo ? Price.shippingInfo : undefined}
        discountValue={Price.discountValue}
        strikePrice={{ ...Price.strikePrice }}
      />
    </CardProduct.Wrapper>

    {showDelivery ? (
      <CardProduct.Wrapper area={Areas.DELIVERY}>
        <CardProduct.Delivery
          status={delivery?.status}
          title={delivery?.title}
          text={delivery?.text}
          highlightTitle={delivery?.highlightTitle}
        />
      </CardProduct.Wrapper>
    ) : null}

    {showPickup ? (
      <CardProduct.Wrapper area={Areas.PICKUP}>
        <CardProduct.Pickup
          status={pickup?.status}
          title={pickup?.title}
          text={pickup?.text}
          highlightTitle={pickup?.highlightTitle}
          marketSelector={pickup?.marketSelector}
          showModelAvailability={pickup?.showModelAvailability}
        />
      </CardProduct.Wrapper>
    ) : null}

    {showBasket ? <CardProduct.Basket /> : null}
    {showWishlist ? <CardProduct.Wishlist /> : null}
    {showQuantity ? (
      <CardProduct.Wrapper area={CardProductGridAreas.QUANTITY}>
        <CopyText color="grey6" tag="p" variant="body">
          Anzahl: 5
        </CopyText>
      </CardProduct.Wrapper>
    ) : null}
  </CardProduct>
);
